solution:
We can factor a constant out of the first radical:
\begin{align*}
\sqrt{4+\sqrt{16+16a}} &= \sqrt{4+\sqrt{16(1+a)}}\\
&= \sqrt{4+4\sqrt{1+a}}\\
&= \sqrt{4(1+\sqrt{1+a})}\\
&= 2\sqrt{1+\sqrt{1+a}}
\end{align*}Then, we can combine like terms and solve:

\begin{align*}
2\sqrt{1+\sqrt{1+a}}+ \sqrt{1+\sqrt{1+a}} &= 6\\
\Rightarrow 3\sqrt{1+\sqrt{1+a}} &= 6\\
\Rightarrow \sqrt{1+\sqrt{1+a}} &= 2\\
\Rightarrow 1+\sqrt{1+a} &= 4\\
\Rightarrow \sqrt{1+a} &= 3\\
\Rightarrow 1+a &= 9\\
\Rightarrow a &= \boxed{8}
\end{align*}

We can expand the determinant as follows:
\begin{align*}
\begin{vmatrix} 0 & b - a & c - a \\ a - b & 0 & c - b \\ a - c & b - c & 0 \end{vmatrix} &= -(b - a) \begin{vmatrix} a - b & c - b \\ a - c & 0 \end{vmatrix} + (c - a) \begin{vmatrix} a - b & 0 \\ a - c & b - c \end{vmatrix} \\
&= -(b - a)(-(c - b)(a - c)) + (c - a)(a - b)(b - c) \\
&= \boxed{0}.
\end{align*}

We can line up the numbers and subtract just as we do in base 10.  For example, when we borrow from the $3^1$s place, the digit 1 in the units place becomes $4$, while the digit in the $3^1$s place decreases by 1. Continuing in this way, we find $$\begin{array}{c@{}c@{}c@{}c@{}c}
& \cancelto{1}{2} & \cancelto{4}{1} & \cancelto{1}{2} & \cancelto{4}{1}_3 \\
-& & 2 & 1 & 2_3 \\
\cline{2-5}
& 1 & 2 & 0 & 2_3 \\
\end{array}$$So the difference is $\boxed{1202_3}$.

problem:
