Then by Pythagoras, $(2x + 42)^2 + 105^2 = (5x)^2$.  This simplifies to $21x^2 - 168x - 12789 = 0$, which factors as $21(x - 29)(x + 21) = 0$, so $x = 29$.  Therefore, $AC = 5x = \boxed{145}$.

We have that
\begin{align*}
\frac{\csc \theta}{\sin \theta} - \frac{\cot \theta}{\tan \theta} &= \frac{1/\sin \theta}{\sin \theta} - \frac{\cos \theta/\sin \theta}{\sin \theta/\cos \theta} \\
&= \frac{1}{\sin^2 \theta} - \frac{\cos^2 \theta}{\sin^2 \theta} \\
&= \frac{1 - \cos^2 \theta}{\sin^2 \theta} = \frac{\sin^2 \theta}{\sin^2 \theta} = \boxed{1}.
\end{align*}

A $y$-intercept is a point on the graph that lies on the $y$-axis, so $x = 0$.  Hence, the number $y$-intercepts corresponds to the number of real solutions of the quadratic equation $-y^2 + 4y - 4$.  The discriminant of this quadratic equation is $4^2 - 4 \cdot (-1) \cdot (-4) = 0$, so the quadratic has exactly one real root.  (We can also see this by writing $-y^2 + 4y - 4 = -(y - 2)^2$.)  Therefore, the number of $y$-intercepts is $\boxed{1}$.

