The $x$-coordinates of the other two vertices satisfy $ax+c=bx+d$ and $ax+d=bx+c$, so the $x$-coordinates are $\pm(c-d)/(b-a)$. Thus the parallelogram is composed of two triangles, each of which has area \[
9=\frac{1}{2} \cdot |c-d| \cdot \left|\frac{c-d}{b-a}\right|.
\]It follows that $(c-d)^2=18|b-a|$.

By a similar argument using the second parallelogram, $(c+d)^2=72|b-a|$. Subtracting the first equation from the second yields $4cd=54|b-a|$, so $2cd = 27|b-a|$. Thus $|b-a|$ is even, and $a+b$ is minimized when $\{a,b\}=\{1,3\}$. Also, $cd$ is a multiple of 27, and $c+d$ is minimized when $\{c,d\}=\{3,9\}$. Hence the smallest possible value of $a+b+c+d$ is $1+3+3+9=\boxed{16}$. Note that the required conditions are satisfied when $(a,b,c,d)=(1,3,3,9)$.

The problem asks us to count the number of complex numbers that lie in or on the circle of radius 5 centered at the origin, with integer real and imaginary parts.

[asy]
unitsize(0.5 cm);

int i, j;

draw((-5,0)--(5,0));
draw((0,-5)--(0,5));
draw(Circle((0,0),5));

for (i = -5; i <= 5; ++i) {
for (j = -5; j <= 5; ++j) {
  if (i^2 + j^2 > 25) {dot((i,j));}
  if (i^2 + j^2 <= 25) {dot((i,j),red);}
}}
[/asy]

We can count that there are 15 such complex numbers in the first quadrant (not including the axes).  Then there are 5 complex on the positive real axis, the negative real axis, the positive imaginary axis, and negative imaginary axis.  Finally, there is the origin itself, which gives us $4 \cdot 15 + 4 \cdot 5 + 1 = \boxed{81}$ complex numbers.

Since $90^3=729,\!000$, $\text{AB}$ is greater than 90.  Therefore, $\text{A}=9$.  Since the ones digit of $\text{AB}^3$ is 3, $\text{AB}$ must be odd.  The ones digit of $\text{AB}^3$ is the same as the ones digit of $\text{B}^3$, so we look at the ones digits of the cubes of the odd digits. \[
\begin{array}{c}
\text{The ones digit of }1^3 \text{ is } 1. \\ \text{The ones digit of }3^3 \text{ is } 7. \\ \text{The ones digit of }5^3 \text{ is } 5. \\ \text{The ones digit of }7^3 \text{ is } 3. \\ \text{The ones digit of }9^3 \text{ is } 9.
\end{array}
\] Only $7^3$ has a ones digit of 3, so $\text{B}=7$.  Therefore, $\text{A}+\text{B}=9+7=\boxed{16}$.

Since $39 = 2 \times 18 + 3$, the $39$th digit past the decimal point is the same as the $3$rd digit past the decimal point. To find this, we can directly divide: $$
\begin{array}{c|cccc}
\multicolumn{2}{r}{0} & .0 & 5 & 2 \\
\cline{2-5}
