dot(dots);

draw(A--B--C--D--Ep--F--cycle);

draw(B--H--C,dashed);
draw(D--J--Ep,dashed);
draw(F--G--A,dashed);

label("$A$",A,S);
label("$B$",B,S);
label("$C$",C,NW);
label("$D$",D,NW);
label("$E$",Ep,NE);
label("$F$",F,NE);
label("$G$",G,SE);
label("$H$",H,SW);
