Let $n$ be the number of soldiers. According to the problem statement, it follows that \begin{align*}
n &\equiv 0 \pmod{4} \\
n &\equiv 2 \pmod{3} \\
n &\equiv 5 \pmod{11}
\end{align*}By the Chinese Remainder Theorem, there is an unique residue that $n$ can leave, modulo $33$; since $5 \equiv 2 \pmod{3}$, it follows that $n \equiv 5 \pmod{33}$. Also, we know that $n$ is divisible by $4$, so by the Chinese Remainder Theorem again, it follows that $n \equiv 104 \pmod{132}$. Writing out the first few positive values of $n$, we obtain that $n = 104, 236, 368$, and so forth. The closest value of $n$ is $\boxed{236}$.

The positive factors of $12$ are $1, 2, 3, 4, 6,$ and $12$. The negative factors of $12$ are $-1, -2, -3, -4, -6,$ and $-12$. When we add these twelve numbers together, we can pair each positive factor with its negation: \begin{align*}
[1+(-1)] + [2 + (-2)] + [3 + (-3)]& + [4 + (-4)] \\
{}+ [6 + (-6)] + [12 + (-12)] &= 0 + 0 + 0 + 0 + 0 + 0 \\
&= \boxed{0}.
\end{align*}

We can find the roots of this equation by using the quadratic formula: $$x = \frac{5 \pm \sqrt{(-5)^2 - (4)(1)(9)}}{2} = \frac{5 \pm i\sqrt{11}}{2}.$$ We wish to find $(a - 1)(b - 1)$, which is \begin{align*}
\left(\frac{5 + i\sqrt{11}}{2} - 1\right)\left(\frac{5 - i\sqrt{11}}{2} - 1\right) &= \left(\frac{3 + i\sqrt{11}}{2}\right)\left(\frac{3 - i\sqrt{11}}{2}\right) \\
&= \frac{9 + 11}{4}\\
&= \boxed{5}
\end{align*}

