problem:
The symbols $\triangle$, $\square$, $\diamond$, $\clubsuit$ represent four different integers from 1 to 9. Using the equations below, what is the value of   $\square$ ? \begin{align*}
\triangle + \square &= \clubsuit \\
\triangle + \triangle &= \diamond +\diamond + \diamond + \diamond + \diamond \\
\triangle + \triangle &= \clubsuit + \diamond.
\end{align*}

solution:
Recall that $a^m\div a^n=a^{m-n}$ for positive integers $m>n$ and $a^m\cdot a^n=a^{m+n}$. Now we can write $5^5\div5^4-5^3+5^2\cdot5^1$ as $5^1-5^3+5^3$. Using the definition of subtraction and the associative property of addition, we get \begin{align*}
5^1-5^3+5^3&=5^1+-5^3+5^3\\
&=5^1+(-5^3+5^3)\\
&=5^1+0\\
&=\boxed{5}.
\end{align*}

Let Amy's, Ben's, and Chris's ages be $a$, $b$, and $c$, respectively. We have the equations \begin{align*} \tag{1}
\frac{a+b+c}{3}=6 \Rightarrow a+b+c&=18 \\ \tag{2}
c-4&=a\\ \tag{3}
b+4&=\frac{3}{5}(a+4)
\end{align*} From Equation (3), we have $b=\frac{3}{5}(a+4)-4$. We substitute Equation (2) into Equation (3) to eliminate $a$, to get $b=\frac{3}{5}(c)-4$. Substituting this last equation and Equation (2) into Equation (1) to eliminate $a$ and $b$, we have  \[[c-4]+[\frac{3}{5}(c)-4]+c=18\] Solving for $c$, we find that $c=10$. Thus, Chris's age is $\boxed{10}$.

problem:
Let  \[ f(x) =
\begin{cases}
-\sqrt[3]x & \text{if } x \geq 0,\\
x^2& \text{if } x <0.
