problem:
Let $a,$ $b,$ $c,$ $d,$ and $e$ be the distinct roots of the equation $x^5 + 7x^4 - 2 = 0.$  Find
\begin{align*}
&\frac{a^5}{(a - b)(a - c)(a - d)(a - e)} + \frac{b^5}{(b - a)(b - c)(b - d)(b - e)} \\
&\quad + \frac{c^5}{(c - a)(c - b)(c - d)(c - e)} + \frac{d^5}{(d - a)(d - b)(d - c)(d - e)} \\
&\quad + \frac{e^5}{(e - a)(e - b)(e - c)(e - d)}.
\end{align*}

solution:
Begin by simplifying the left side: $$3x^2-2x^2-8=42$$ We can combine terms and solve for $x^2$: \begin{align*}
3x^2-2x^2&=42+8\\
\Rightarrow\qquad x^2&=50
\end{align*} Squaring both sides, we find: \begin{align*}
(x^2)^2&=50^2\\
\Rightarrow\qquad x^4&=\boxed{2500}
\end{align*}

Instead of expanding the entire product, we can look only at terms that will multiply to give $x^3$.  We know that $$x^3=x^3\cdot 1=x^2\cdot x=x\cdot x^2=1\cdot x^3.$$Knowing this, the $x^3$ term in the expansion will be the sum of these four terms: $$(6x^3)(4)+(4x^2)(3x)+(-7x)(3x^2)+(-5)(6x^3).$$We simplify to find: \begin{align*}
&(6x^3)(4)+(4x^2)(3x)+(-7x)(3x^2)+(-5)(6x^3)\\
&\qquad=24x^3+12x^3-21x^3-30x^3\\
&\qquad=\boxed{-15}x^3
\end{align*}

We set up the equation and solve for $x$. \begin{align*}
2x+7&=81\quad\Rightarrow\\
2x&=74\quad\Rightarrow\\
x&=\boxed{37}
\end{align*}

The first prime number is $2$ and we know that all prime numbers after that must be odd. $3$, $5$, and $7$ are prime because their only positive integer divisors are $1$ and themselves. $9$ is divisible by $3$ so it is not prime. $11$ and $13$ are prime, but $15$ is not because it is divisible by $3$ and $5$. Continuing, $17$ and $19$ are prime, but $21$ isn't because it is divisible by $3$ and $7$. Finally we know that $23$ is prime.

To sum these nine numbers quicker, we can group them so that they sum to multiples of $10$: \begin{align*}
2+ 3 + 5& + 7 + 11 + 13 + 17 + 19 + 23 \\
& = (3+7) + (11+19) + (13+17) + (23 + 5 + 2) \\
& = 10 + 30 + 30 + 30 \\
& = \boxed{100}
\end{align*}

