problem:
Suppose that $a$ and $b$ are positive real numbers, and let \[f(x) =
\begin{cases}
\frac{a}{b}x & \text{ if }x\le-4, \\
abx^2 & \text{ if }x>-4.
\end{cases}
\]If $f(-4)=-\frac{60}{13}$ and $f(4)=3120$, what is $a+b$?

solution:
Using the quadratic formula, we find that the roots of the quadratic are $\frac{-7\pm\sqrt{7^2-4(4)(k)}}{8}=\frac{-7\pm\sqrt{49-16k}}{8}$. Since the problem tells us that these roots must equal $\frac{-7\pm\sqrt{15}i}{8}$, \begin{align*} \sqrt{49-16k}&=\sqrt{15}i
\\\Rightarrow\qquad \sqrt{49-16k}&=\sqrt{-15}
\\\Rightarrow\qquad 49-16k&=-15
\\\Rightarrow\qquad 16k&=64
\\\Rightarrow\qquad k&=\boxed{4}.
\end{align*}

problem:
For what negative value of $k$ is there exactly one solution to the system of equations \begin{align*}
y &= 2x^2 + kx + 6 \\
y &= -x + 4?
\end{align*}

solution:
Using the quadratic formula, we find that the roots of the quadratic are $\frac{-5\pm\sqrt{5^2-4(3)(k)}}{6}=\frac{-5\pm\sqrt{25-12k}}{6}$. Since the problem tells us that these roots must equal $\frac{-5\pm i\sqrt{11}}{6}$, we have \begin{align*} \sqrt{25-12k}&=i\sqrt{11}
\\\Rightarrow\qquad \sqrt{25-12k}&=\sqrt{-11}
\\\Rightarrow\qquad 25-12k&=-11
\\\Rightarrow\qquad 12k&=36
\\\Rightarrow\qquad k&=\boxed{3}.
\end{align*}

