problem:
Find $a+b+c$, given that $x+y\neq -1$ and  \begin{align*}
ax+by+c&=x+7,\\
a+bx+cy&=2x+6y,\\
ay+b+cx&=4x+y.
\end{align*}

solution:
Since these equations look symmetric, at least on the left-hand side, we add all three together.  This gives us  \begin{align*}
&a(x+1+y)+b(y+x+1)+c(1+y+x)\\
&\qquad\qquad=x+7+2x+6y+4x+y.
\end{align*} We then factor out $(1+x+y)$ on the left and simplify the right side to get \begin{align*}
(1+x+y)(a+b+c)&=7x+7y+7, \text{ so}\\
(1+x+y)(a+b+c)&=7(1+x+y).
\end{align*}

Since $x+y\neq -1$, we know $x+y+1\neq 0$, so we can divide both sides by that term and find that $a+b+c=\boxed{7}$.

Let the number of clowns in the parade be $c$ and the number of horses be $h$. We are looking for the value of $h$. Assuming that each clown has 2 legs and 1 head, and that each horse has 4 legs and 1 head, we can set up the following system of equations:

\begin{align*}
2c+4h &= 30 \\
c + h &= 10 \\
\end{align*}

To solve for $h$, we need to eliminate $c$ from the equations above. We can rewrite the second equation above as $c=10-h$, and substituting this into the first equation to eliminate $c$ gives $2(10-h)+4h = 30$, or $h=5$. Thus, there are $\boxed{5}$ horses in the parade.

problem:
Let $f$ be defined by  \[f(x) = \left\{
\begin{array}{cl}
3-x & \text{ if } x \leq 3, \\
-x^3+2x^2+3x & \text{ if } x>3.
\end{array}
\right.\]Calculate $f^{-1}(0)+f^{-1}(6)$.

solution:
The number $f^{-1}(0)$ is the value of $x$ such that $f(x) = 0$.  Since the function $f$ is defined piecewise, to find this value, we must consider both cases $x \le 3$ and $x > 3$.

If $x \le 3$ and $f(x) = 0$, then $3 - x = 0$, which leads to $x = 3$.  Note that this value satisfies the condition $x \le 3$.  If $x > 3$ and $f(x) = 0$, then $-x^3 + 2x^2 + 3x = 0$.  This equation factors as $-x(x - 3)(x + 1) = 0$, so $x = 0$, $x = 3$, or $x = -1$.  But none of these values satisfies $x > 3$, so the solution is $x = 3$, which means $f^{-1}(0) = 3$.

Now we compute $f^{-1}(6)$, which is the value of $x$ such that $f(x) = 6$.

If $x \le 3$ and $f(x) = 6$, then $3 - x = 6$, which leads to $x = -3$.  Note that this value satisfies the condition $x \le 3$.  If $x > 3$ and $f(x) = 6$, then $-x^3 + 2x^2 + 3x = 6$, or $x^3 - 2x^2 - 3x + 6 = 0$.  This equation factors as $(x - 2)(x^2 - 3) = 0$, so $x = 2$, $x = \sqrt{3}$, or $x = -\sqrt{3}$.  But none of these values satisfies $x > 3$, so the solution is $x = -3$, which means $f^{-1}(6) = -3$.

Therefore, $f^{-1}(0)+f^{-1}(6) = 3 + (-3) = \boxed{0}$.

